import Link from "next/link";

const layoutStyle = {
    margin: 20,
    padding: 20,
    border: '1px solid #DDD'
};


const Header = () => (
    <div style={{ display: 'flex', flexDirection: 'row', justifyContent: 'space-around', width: '30%' }}>
        <Link to="/">
            <h5>Tracker</h5>
        </Link>
        <Link>
            <h5>News</h5>
        </Link>
    </div>
)

export default function Layout({ children }) {
    return (
        <div style={layoutStyle}>
            <Header />
            {children}
        </div>
    )
}
